import React from 'react';

export default class WhatIsPoc extends React.Component {
    render() {
       return (
          <div>

          <h2>
               What is Peace of Cake?
            </h2>
            <p>
               Peace of Cake is the simplest way to create and source a delicious themed cake for your next party, birthday, office event, or even wedding. We'll even make sure you get a great price on your cake from local Cake experts. Need delivery? No problem. We'll arrange everything to make sure your next event is a hit.
            </p>

          </div>
       );
    }
 };
